import { Col, Row, Card } from 'antd'
import React, { Component } from 'react'
import axios from 'axios';

export default class MaleArtistList extends Component {
    state = {data: []};

    componentDidMount() {
        
        axios({
            method: 'GET',
            url: 'http://localhost:3001/artist/cat',
            params: {
                artistType: this.props.match.params.artistType
            }
        }).then((response) => {
            console.log(response.data);
            this.setState({data: response.data});
        });
    }

    render() {
        console.log(this.props.match.params);
        return (
            <div className="cardList">
                <Row gutter={16}>
                    <Col span={6}>
                        123
                    </Col>
                </Row>
            </div>
        )
    }
}
